Joel David Hubbard, Joel Hubbard, &quot;A Concise Review of Clinical Laboratory Science, 2nd Edition&quot;
English | 2009 | ISBN: 0781782023 | 432 pages | PDF | 3 MB

The Second Edition offers a concise review of all areas of clinical lab science, including the standard areas, such as hematology, chemistry, hemostasis, immunohematology, clinical microbiology, parasitology, urinalysis and more, as well as lab management, lab government regulations, and quality assurance. 
A companion website offers 35 case studies, an image bank of color images, and a quiz bank with 500 questions in certification format.
